import wrapComponent from '../../tools/wrapComponent.js';

/**
 * Generic container for `HeaderGlobalAction` components
 */
var HeaderGlobalBar = wrapComponent({
  name: 'HeaderGlobalBar',
  className: prefix => `${prefix}--header__global`,
  type: 'div'
